import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import './App.css'
// import App from './App';

function App() {
  window.navigator.geolocation.getCurrentPosition(
      (position)=> console.log(position),
      (err)=> console.log(err)
  );

  return <div>Latitude: </div>
}
ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.querySelector('#root')
);
